    //                 </Paper>
    //             </div>
    //         </Button>
    //     );
    // } else {

    return (
        <div>
            <img src={wellBeingIcon}
                alt=""
                width="130px"
                onMouseEnter={showPopover}
                onMouseLeave={closePopover}
                onClick={() => {
                    props.showWellBeingIconText();
                }}
            />
            <Popover
                id="mouse-over-popover"
                className={classes.popover}
                classes={{
                    paper: classes.paper,
                }}
                open={open}
                anchorEl={anchorEl}
                anchorOrigin={{
                    vertical: 'bottom',
                    horizontal: 'right',
                }}
                transformOrigin={{
                    vertical: 'top',
                    horizontal: 'right',
                }}
                onClose={closePopover}
                PaperProps={{
                    style: {
                        backgroundColor: "transparent",
                    },
                }}
                disableRestoreFocus
            >Well-being</Popover>
        </div>
    )
}
